  6	export interface PercentileMetrics {
  7	  p50: number;
  8	  p95: number;
  9	  p99: number;
 10	}
 11	
 12	export class MetricsCollector {
 13	  private static instance: MetricsCollector;
 14	  private metrics: Map<string, Map<string, Metric[]>> = new Map();
 15	  private readonly maxDataPoints = 1000;
 16	  private readonly retentionPeriod = 3600000; // 1 hora
 17	
 18	  private constructor() {
 19	    // Limpar métricas antigas periodicamente
 20	    setInterval(() => this.cleanOldMetrics(), 60000); // A cada minuto
 21	  }
 22	
 23	  static getInstance(): MetricsCollector {
 24	    if (!MetricsCollector.instance) {
 25	      MetricsCollector.instance = new MetricsCollector();
 26	    }
 27	    return MetricsCollector.instance;
 28	  }
 29	
 30	  recordMetric(category: string, metric: string, value: number): void {
 31	    if (!this.metrics.has(category)) {
 32	      this.metrics.set(category, new Map());
 33	    }
 34	
 35	    const categoryMetrics = this.metrics.get(category)!;
 36	    if (!categoryMetrics.has(metric)) {
 37	      categoryMetrics.set(metric, []);
 38	    }
 39	
 40	    const metricData = categoryMetrics.get(metric)!;
 41	    metricData.push({
 42	      value,
 43	      timestamp: Date.now()
 44	    });
 45	
 46	    // Manter apenas os últimos N pontos
 47	    if (metricData.length > this.maxDataPoints) {
 48	      metricData.shift();
 49	    }
 50	  }
 51	
 52	  getMetric(category: string, metric: string): Metric[] {
 53	    return this.metrics.get(category)?.get(metric) || [];
 54	  }
 55	
 56	  getPercentiles(category: string, metric: string): PercentileMetrics {
 57	    const data = this.getMetric(category, metric);
 58	    if (data.length === 0) {
 59	      return { p50: 0, p95: 0, p99: 0 };
 60	    }
