  1	import React, { useState, useEffect } from 'react';
  2	import { HealthChecker, SystemHealth, HealthCheckResult } from './health-checker';
  3	import { MetricsCollector } from '../utils/metrics-collector';
  4	import { formatDistanceToNow } from 'date-fns';
  5	import { ptBR } from 'date-fns/locale';
  6	
  7	interface MonitoringDashboardProps {
  8	  healthChecker: HealthChecker;
  9	  metricsCollector: MetricsCollector;
 10	}
 11	
 12	export const MonitoringDashboard: React.FC<MonitoringDashboardProps> = ({ 
 13	  healthChecker, 
 14	  metricsCollector 
 15	}) => {
 16	  const [health, setHealth] = useState<SystemHealth | null>(null);
 17	  const [metrics, setMetrics] = useState<Record<string, any>>({});
 18	  const [selectedService, setSelectedService] = useState<string | null>(null);
 19	  const [autoRefresh, setAutoRefresh] = useState(true);
 20	  const [refreshInterval, setRefreshInterval] = useState(30000);
 21	
 22	  useEffect(() => {
 23	    // Carregar dados iniciais
 24	    loadHealthData();
 25	    loadMetricsData();
 26	
 27	    // Configurar listeners
 28	    const unsubscribe = healthChecker.onHealthChange(setHealth);
 29	
 30	    // Auto-refresh
 31	    let interval: number | null = null;
 32	    if (autoRefresh) {
 33	      interval = window.setInterval(() => {
 34	        loadHealthData();
 35	        loadMetricsData();
 36	      }, refreshInterval);
 37	    }
 38	
 39	    return () => {
 40	      unsubscribe();
 41	      if (interval) clearInterval(interval);
 42	    };
 43	  }, [autoRefresh, refreshInterval]);
 44	
 45	  const loadHealthData = async () => {
 46	    const healthData = await healthChecker.runAllChecks();
 47	    setHealth(healthData);
 48	  };
 49	
 50	  const loadMetricsData = () => {
 51	    const allMetrics = metricsCollector.getAllMetrics();
 52	    setMetrics(allMetrics);
 53	  };
 54	
 55	  const getStatusColor = (status: 'healthy' | 'degraded' | 'unhealthy') => {
 56	    switch (status) {
 57	      case 'healthy': return 'text-green-600 bg-green-100';
 58	      case 'degraded': return 'text-yellow-600 bg-yellow-100';
 59	      case 'unhealthy': return 'text-red-600 bg-red-100';
 60	    }
 61	  };
 62	
 63	  const getStatusIcon = (status: 'healthy' | 'degraded' | 'unhealthy') => {
 64	    switch (status) {
 65	      case 'healthy': return '✓';
 66	      case 'degraded': return '⚠';
 67	      case 'unhealthy': return '✗';
 68	    }
 69	  };
 70	
 71	  const formatLatency = (ms?: number) => {
 72	    if (!ms) return '-';
 73	    if (ms < 1000) return `${ms}ms`;
 74	    return `${(ms / 1000).toFixed(2)}s`;
 75	  };
 76	
 77	  const renderMetricValue = (value: any): string => {
 78	    if (typeof value === 'number') {
 79	      return value.toFixed(2);
 80	    }
 81	    if (typeof value === 'object' && value !== null) {
 82	      if ('p50' in value && 'p95' in value && 'p99' in value) {
 83	        return `P50: ${value.p50.toFixed(0)}ms | P95: ${value.p95.toFixed(0)}ms | P99: ${value.p99.toFixed(0)}ms`;
 84	      }
 85	    }
 86	    return String(value);
 87	  };
 88	
 89	  if (!health) {
 90	    return (
 91	      <div className="monitoring-dashboard p-6">
 92	        <div className="text-center text-gray-500">Carregando dados de monitoramento...</div>
 93	      </div>
 94	    );
 95	  }
 96	
 97	  return (
 98	    <div className="monitoring-dashboard p-6 bg-gray-50 min-h-screen">
 99	      <div className="max-w-7xl mx-auto">
100	        {/* Header */}
101	        <div className="header mb-8">
102	          <div className="flex justify-between items-center mb-4">
103	            <h1 className="text-3xl font-bold">Dashboard de Monitoramento</h1>
104	            
105	            <div className="controls flex items-center gap-4">
106	              <label className="flex items-center">
107	                <input
108	                  type="checkbox"
109	                  checked={autoRefresh}
110	                  onChange={(e) => setAutoRefresh(e.target.checked)}
111	                  className="mr-2"
112	                />
113	                <span>Auto-refresh</span>
114	              </label>
115	              
116	              <select
117	                value={refreshInterval}
118	                onChange={(e) => setRefreshInterval(Number(e.target.value))}
119	                className="px-3 py-1 border rounded"
120	              >
121	                <option value={10000}>10s</option>
122	                <option value={30000}>30s</option>
123	                <option value={60000}>1m</option>
124	                <option value={300000}>5m</option>
125	              </select>
126	              
127	              <button
128	                onClick={() => {
129	                  loadHealthData();
130	                  loadMetricsData();
131	                }}
132	                className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
133	              >
134	                Atualizar
135	              </button>
136	            </div>
137	          </div>
138	          
139	          {/* Overall Status */}
140	          <div className={`overall-status p-4 rounded-lg ${getStatusColor(health.overall)}`}>
141	            <div className="flex items-center gap-2">
142	              <span className="text-2xl">{getStatusIcon(health.overall)}</span>
143	              <span className="text-xl font-semibold capitalize">
144	                Sistema {health.overall === 'healthy' ? 'Saudável' : 
145	                        health.overall === 'degraded' ? 'Degradado' : 'Com Problemas'}
146	              </span>
147	              <span className="text-sm ml-auto">
148	                Última verificação: {formatDistanceToNow(health.timestamp, { addSuffix: true, locale: ptBR })}
149	              </span>
150	            </div>
151	          </div>
152	        </div>
153	
154	        {/* Services Grid */}
155	        <div className="services-grid grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 mb-8">
156	          {health.checks.map((check) => (
157	            <div
158	              key={check.service}
159	              className={`service-card p-4 bg-white rounded-lg shadow cursor-pointer hover:shadow-lg transition-shadow ${
160	                selectedService === check.service ? 'ring-2 ring-blue-500' : ''
161	              }`}
162	              onClick={() => setSelectedService(check.service)}
163	            >
164	              <div className="flex justify-between items-start mb-2">
165	                <h3 className="font-semibold capitalize">{check.service}</h3>
166	                <span className={`px-2 py-1 rounded text-sm ${getStatusColor(check.status)}`}>
167	                  {getStatusIcon(check.status)} {check.status}
168	                </span>
169	              </div>
170	              
171	              <p className="text-sm text-gray-600 mb-2">{check.message}</p>
172	              
173	              {check.latency && (
174	                <p className="text-sm text-gray-500">
175	                  Latência: {formatLatency(check.latency)}
176	                </p>
177	              )}
178	              
179	              {check.details && (
180	                <div className="mt-2 pt-2 border-t">
181	                  {Object.entries(check.details).slice(0, 2).map(([key, value]) => (
182	                    <p key={key} className="text-xs text-gray-500">
183	                      {key}: {typeof value === 'number' ? value.toFixed(1) : String(value)}
184	                    </p>
185	                  ))}
186	                </div>
187	              )}
188	            </div>
189	          ))}
190	        </div>
191	
192	        {/* Metrics Section */}
193	        <div className="metrics-section mb-8">
194	          <h2 className="text-2xl font-bold mb-4">Métricas de Performance</h2>
195	          
196	          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
197	            {Object.entries(metrics).map(([category, categoryMetrics]) => (
198	              <div key={category} className="metrics-card bg-white p-4 rounded-lg shadow">
199	                <h3 className="font-semibold mb-3 capitalize">{category}</h3>
200	                
201	                <div className="space-y-2">
202	                  {Object.entries(categoryMetrics as Record<string, any>).map(([metric, value]) => (
203	                    <div key={metric} className="metric-row flex justify-between items-center">
204	                      <span className="text-sm text-gray-600">{metric}:</span>
205	                      <span className="text-sm font-mono">
