4. [MetricsCollector - Coletor de Métricas](#metricscollector---coletor-de-métricas)
5. [MonitoringDashboard - Dashboard de Monitoramento](#monitoringdashboard---dashboard-de-monitoramento)
6. [Dados Reais vs Dados Mockados](#dados-reais-vs-dados-mockados)
7. [Guia de Uso](#guia-de-uso)
8. [Configurações e Personalização](#configurações-e-personalização)

## Visão Geral

O Sistema de Monitoramento é uma solução completa para acompanhar a saúde e performance de aplicações web. Ele fornece:

- **Monitoramento em tempo real** de serviços críticos
- **Coleta de métricas** de performance
- **Dashboard interativo** com visualização de dados
- **Alertas e notificações** sobre problemas
- **Histórico de métricas** com análise de tendências

### Características Principais

- ✅ **100% Dados Reais**: Não utiliza dados mockados em produção
- ✅ **Auto-refresh configurável**: Atualização automática entre 10s a 5m
- ✅ **Verificações de saúde**: Database, Storage, Network, Memory
- ✅ **Métricas de performance**: Latência, CPU, Memória, Requisições
- ✅ **Interface responsiva**: Funciona em desktop e mobile

## Arquitetura do Sistema

```
┌─────────────────────────────────────────────────┐
│          MonitoringDashboard (React)            │
│  ┌──────────────┐        ┌──────────────────┐  │
│  │   UI/Visual  │        │  Auto-refresh    │  │
│  │  Components  │        │    Controller    │  │
│  └──────┬───────┘        └────────┬─────────┘  │
│         │                         │             │
│         └────────────┬────────────┘             │
│                      ▼                          │
│         ┌────────────────────────┐              │
│         │    State Management    │              │
│         └────────────────────────┘              │
└─────────────────────┬───────────────────────────┘
                      │
        ┌─────────────┴──────────────┐
        ▼                            ▼
┌─────────────────┐         ┌──────────────────┐
│  HealthChecker  │         │ MetricsCollector │
├─────────────────┤         ├──────────────────┤
│ • Database      │         │ • Performance    │
│ • Storage       │         │ • Latency        │
│ • Network       │         │ • Usage Stats    │
│ • Memory        │         │ • Custom Metrics │
└─────────────────┘         └──────────────────┘
        │                            │
        └─────────────┬──────────────┘
                      ▼
            ┌─────────────────┐
            │  Data Sources   │
            ├─────────────────┤
            │ • PGLite DB     │
            │ • Browser APIs  │
            │ • WebSocket     │
            │ • IndexedDB     │
            └─────────────────┘
```

## HealthChecker - Verificador de Saúde

O `HealthChecker` é responsável por verificar a saúde de diversos serviços e componentes do sistema.

### Como Funciona

```typescript
// Inicialização
const healthChecker = new HealthChecker(
  30000,  // Intervalo entre verificações (30s)
  5000    // Timeout por verificação (5s)
);
```

### Verificações Disponíveis

#### 1. Database Check
Verifica a conectividade e latência do banco de dados PGLite.

```typescript
// Executa: SELECT 1 as test
// Métricas:
// - Latência < 100ms: healthy (saudável)
// - Latência 100-500ms: degraded (degradado)
// - Latência > 500ms: unhealthy (com problemas)
```

#### 2. PGLite Storage Check
Monitora o uso de armazenamento do navegador.

```typescript
// Utiliza: navigator.storage.estimate()
// Status:
// - Uso < 80%: healthy
// - Uso 80-95%: degraded
// - Uso > 95%: unhealthy
```

#### 3. IndexedDB Check
Testa operações de leitura/escrita no IndexedDB.

```typescript
// Operações testadas:
// - Criar/abrir database
// - Escrever dados de teste
// - Ler dados de teste
// - Deletar dados de teste
// Mede latência total das operações
```

#### 4. Network Check
Verifica conectividade de rede e latência.

```typescript
// Testa:
// - navigator.onLine
// - Fetch para endpoint de health check
// - Mede latência da requisição
```

#### 5. Memory Check
Monitora uso de memória do navegador.

```typescript
// Utiliza: performance.memory (quando disponível)
// Monitora:
// - usedJSHeapSize
// - totalJSHeapSize
// - jsHeapSizeLimit
// Calcula percentual de uso
```

#### 6. WebSocket Check
Verifica status da conexão WebSocket para sincronização.

```typescript
// Verifica:
// - Estado da conexão (OPEN, CLOSED, etc)
// - Tempo desde última mensagem
// - Latência de ping/pong
```

### Registrando Verificações Customizadas

```typescript
healthChecker.registerCheck('custom-service', async () => {
  const start = Date.now();

  try {
    // Sua lógica de verificação aqui
    await minhaVerificacao();

    return {
      service: 'custom-service',
      status: 'healthy',
      latency: Date.now() - start,
      message: 'Serviço funcionando normalmente',
      timestamp: Date.now()
    };
  } catch (error) {
    return {
      service: 'custom-service',
      status: 'unhealthy',
      message: `Erro: ${error.message}`,
      timestamp: Date.now()
    };
  }
});
```

## MetricsCollector - Coletor de Métricas

O `MetricsCollector` é um singleton que coleta e armazena métricas de performance.

### Estrutura de Dados

```typescript
interface Metric {
  value: number;
  timestamp: number;
}

interface PercentileMetrics {
  p50: number;  // Mediana
  p95: number;  // 95º percentil
  p99: number;  // 99º percentil
}
```

### Funcionalidades

#### 1. Coleta de Métricas
```typescript
const collector = MetricsCollector.getInstance();

// Registrar uma métrica
collector.recordMetric('performance', 'api-latency', 125.5);
collector.recordMetric('system', 'cpu-usage', 42.3);
collector.recordMetric('app', 'active-users', 150);
```

#### 2. Cálculo de Percentis
```typescript
// Obtém percentis P50, P95, P99
const percentis = collector.getPercentiles('performance', 'api-latency');
console.log(`P50: ${percentis.p50}ms`);
console.log(`P95: ${percentis.p95}ms`);
console.log(`P99: ${percentis.p99}ms`);
```

#### 3. Média e Taxa
```typescript
// Média de todas as métricas
const media = collector.getAverage('system', 'cpu-usage');

// Taxa por segundo (últimos 60s)
const requestRate = collector.getRate('app', 'requests', 60000);
```

#### 4. Configurações

- **maxDataPoints**: 1000 pontos por métrica
- **retentionPeriod**: 1 hora (3600000ms)
- **Limpeza automática**: A cada minuto

### Métricas Coletadas Automaticamente

1. **Performance**
   - API Latency
   - Page Load Time
   - DOM Content Loaded
   - First Paint

2. **Sistema**
   - CPU Usage (estimado)
   - Memory Usage
   - Storage Usage
   - Active Connections

3. **Aplicação**
   - Active Users
   - Requests/min
   - Errors/min
   - Success Rate

## MonitoringDashboard - Dashboard de Monitoramento

O `MonitoringDashboard` é o componente React que visualiza todas as informações.

### Componentes Visuais

#### 1. Header com Status Geral
```typescript
// Mostra status consolidado:
// - 🟢 Sistema Saudável (todos os checks healthy)
// - 🟡 Sistema Degradado (algum check degraded)
// - 🔴 Sistema com Problemas (algum check unhealthy)
```

#### 2. Grid de Serviços
Cada card mostra:
- Nome do serviço
- Status com cor e ícone
- Mensagem de status
- Latência (quando aplicável)
- Detalhes adicionais

#### 3. Seção de Métricas
Exibe métricas agrupadas por categoria:
- Performance (latências, percentis)
- Sistema (CPU, memória)
- Aplicação (requisições, erros)

#### 4. Detalhes do Serviço Selecionado
Ao clicar em um serviço:
- Informações detalhadas
- Histórico de status
- JSON completo dos detalhes
- Ações específicas

#### 5. Ações Rápidas
Botões para:
- Testar Database
- Testar Rede
- Resetar Métricas
- Forçar Atualização

### Auto-refresh

```typescript
// Opções de intervalo:
// - 10 segundos
// - 30 segundos (padrão)
// - 1 minuto
// - 5 minutos

// Toggle on/off disponível
// Atualização manual sempre disponível
```

### Interações

1. **Clique nos cards**: Abre detalhes do serviço
2. **Hover effects**: Destaque visual
3. **Responsividade**: Layout adapta para mobile
4. **Notificações**: Alertas para mudanças de status

## Dados Reais vs Dados Mockados

### Dados Reais (Produção)

O sistema **sempre** usa dados reais em produção:

1. **HealthChecker**: Executa verificações reais
   - Queries no banco de dados
   - APIs do navegador
   - Requisições de rede

2. **MetricsCollector**: Coleta métricas reais
   - Performance.now() para latências
   - Navigator APIs para sistema
   - Contadores reais de eventos

3. **Sem simulação**: Nenhum Math.random() ou dados fixos

### Dados Mockados (Desenvolvimento)

Mocks encontrados apenas em:

1. **debug-hooks.ts**: 
   ```typescript
   // Apenas para simular vazamento de memória em debug
   const leak = new Array(1000000).fill(Math.random());
   ```

2. **seed.ts**:
   ```typescript
   // Apenas para popular banco com dados iniciais
   await seed(db, { todos, projects });
   ```

### Como Identificar

Sinais de dados reais:
- ✅ Valores dinâmicos que mudam
- ✅ Latências variáveis
- ✅ Percentuais com decimais
- ✅ Timestamps atuais
- ✅ Erros ocasionais reais

Sinais de mock:
- ❌ Valores sempre iguais
- ❌ Padrões repetitivos
- ❌ Números redondos demais
- ❌ Sem variação temporal
- ❌ Perfeição irreal

## Guia de Uso

### 1. Visualizando o Dashboard

```typescript
// Importar componentes necessários
import { MonitoringDashboard } from './monitoring/monitoring-dashboard';
import { HealthChecker } from './monitoring/health-checker';
import { MetricsCollector } from './utils/metrics-collector';

// Criar instâncias
const healthChecker = new HealthChecker();
const metricsCollector = MetricsCollector.getInstance();

// Renderizar dashboard
<MonitoringDashboard 
  healthChecker={healthChecker}
  metricsCollector={metricsCollector}
/>
```

### 2. Monitorando Métricas Customizadas

```typescript
// Em qualquer parte do código
const collector = MetricsCollector.getInstance();

// Exemplo: Monitorar tempo de resposta de API
const start = performance.now();
const response = await fetch('/api/data');
const latency = performance.now() - start;

collector.recordMetric('api', 'response-time', latency);
```

### 3. Adicionando Novos Health Checks

```typescript
// Exemplo: Verificar API externa
healthChecker.registerCheck('external-api', async () => {
  try {
    const start = Date.now();
    const response = await fetch('https://api.exemplo.com/health');
    const latency = Date.now() - start;

    if (response.ok) {
      return {
        service: 'external-api',
        status: 'healthy',
        latency,
        message: 'API externa respondendo',
        timestamp: Date.now()
      };
    } else {
      return {
        service: 'external-api',
        status: 'degraded',
        latency,
        message: `API retornou ${response.status}`,
        timestamp: Date.now()
      };
    }
  } catch (error) {
    return {
      service: 'external-api',
      status: 'unhealthy',
      message: `Erro: ${error.message}`,
      timestamp: Date.now()
    };
  }
});
```

## Configurações e Personalização

### 1. Intervalo de Verificação

```typescript
// Padrão: 30 segundos
const healthChecker = new HealthChecker(
  60000,  // Verificar a cada 60 segundos
  10000   // Timeout de 10 segundos
);
```

### 2. Retenção de Métricas

```typescript
// Em MetricsCollector
private readonly maxDataPoints = 1000;      // Máximo de pontos
private readonly retentionPeriod = 3600000; // 1 hora
```

### 3. Thresholds de Status

```typescript
// Customizar limites de latência
const getStatus = (latency: number): string => {
  if (latency < 100) return 'healthy';
  if (latency < 500) return 'degraded';
  return 'unhealthy';
};
```

### 4. Cores e Estilos

```typescript
// Em monitoring-dashboard.tsx
const getStatusColor = (status: string) => {
  switch (status) {
    case 'healthy': return 'text-green-600 bg-green-100';
    case 'degraded': return 'text-yellow-600 bg-yellow-100';
    case 'unhealthy': return 'text-red-600 bg-red-100';
  }
};
```

### 5. Notificações

```typescript
// Adicionar listener para mudanças
healthChecker.onHealthChange((health) => {
  if (health.overall === 'unhealthy') {
    // Enviar notificação
    notify('Sistema com problemas!', 'error');
  }
});
```

## Boas Práticas

1. **Não sobrecarregar com checks**: Mantenha intervalo razoável
2. **Timeouts apropriados**: Evite checks muito longos
3. **Métricas relevantes**: Colete apenas o necessário
4. **Limpeza de dados**: Configure retenção adequada
5. **Tratamento de erros**: Sempre capture exceções
6. **Performance**: Use Web Workers para checks pesados

## Troubleshooting

### Dashboard não atualiza
- Verificar se auto-refresh está ativado
- Checar console para erros
- Verificar se healthChecker está rodando

### Métricas não aparecem
- Confirmar que collector está registrando
- Verificar categoria e nome da métrica
- Checar se não passou do período de retenção

### Status sempre unhealthy
- Revisar thresholds de latência
- Verificar conectividade real
- Checar permissões do navegador

---

*Última atualização: Janeiro 2025*

