// - 🟢 Sistema Saudável (todos os checks healthy)
// - 🟡 Sistema Degradado (algum check degraded)
// - 🔴 Sistema com Problemas (algum check unhealthy)
```

#### 2. Grid de Serviços
Cada card mostra:
- Nome do serviço
- Status com cor e ícone
- Mensagem de status
- Latência (quando aplicável)
- Detalhes adicionais

#### 3. Seção de Métricas
Exibe métricas agrupadas por categoria:
- Performance (latências, percentis)
- Sistema (CPU, memória)
- Aplicação (requisições, erros)

#### 4. Detalhes do Serviço Selecionado
Ao clicar em um serviço:
- Informações detalhadas
- Histórico de status
- JSON completo dos detalhes
- Ações específicas

#### 5. Ações Rápidas
Botões para:
- Testar Database
- Testar Rede
- Resetar Métricas
- Forçar Atualização

### Auto-refresh

```typescript
// Opções de intervalo:
// - 10 segundos
// - 30 segundos (padrão)
// - 1 minuto
// - 5 minutos

// Toggle on/off disponível
// Atualização manual sempre disponível
```

### Interações

1. **Clique nos cards**: Abre detalhes do serviço
2. **Hover effects**: Destaque visual
3. **Responsividade**: Layout adapta para mobile
4. **Notificações**: Alertas para mudanças de status

## Dados Reais vs Dados Mockados

### Dados Reais (Produção)

O sistema **sempre** usa dados reais em produção:

1. **HealthChecker**: Executa verificações reais
   - Queries no banco de dados
   - APIs do navegador
   - Requisições de rede

2. **MetricsCollector**: Coleta métricas reais
   - Performance.now() para latências
   - Navigator APIs para sistema
   - Contadores reais de eventos

3. **Sem simulação**: Nenhum Math.random() ou dados fixos

### Dados Mockados (Desenvolvimento)

Mocks encontrados apenas em:

1. **debug-hooks.ts**: 
   ```typescript
   // Apenas para simular vazamento de memória em debug
   const leak = new Array(1000000).fill(Math.random());
   ```

2. **seed.ts**:
   ```typescript
   // Apenas para popular banco com dados iniciais
   await seed(db, { todos, projects });
   ```

### Como Identificar

Sinais de dados reais:
- ✅ Valores dinâmicos que mudam
- ✅ Latências variáveis
- ✅ Percentuais com decimais
- ✅ Timestamps atuais
- ✅ Erros ocasionais reais

Sinais de mock:
- ❌ Valores sempre iguais
- ❌ Padrões repetitivos
- ❌ Números redondos demais
- ❌ Sem variação temporal
- ❌ Perfeição irreal

## Guia de Uso

### 1. Visualizando o Dashboard

```typescript
// Importar componentes necessários
import { MonitoringDashboard } from './monitoring/monitoring-dashboard';
import { HealthChecker } from './monitoring/health-checker';
import { MetricsCollector } from './utils/metrics-collector';

// Criar instâncias
const healthChecker = new HealthChecker();
const metricsCollector = MetricsCollector.getInstance();

// Renderizar dashboard
<MonitoringDashboard 
  healthChecker={healthChecker}
  metricsCollector={metricsCollector}
/>
```

### 2. Monitorando Métricas Customizadas

```typescript
// Em qualquer parte do código
const collector = MetricsCollector.getInstance();

// Exemplo: Monitorar tempo de resposta de API
const start = performance.now();
const response = await fetch('/api/data');
const latency = performance.now() - start;

collector.recordMetric('api', 'response-time', latency);
```

### 3. Adicionando Novos Health Checks

```typescript
// Exemplo: Verificar API externa
healthChecker.registerCheck('external-api', async () => {
  try {
    const start = Date.now();
    const response = await fetch('https://api.exemplo.com/health');
    const latency = Date.now() - start;

    if (response.ok) {
      return {
        service: 'external-api',
        status: 'healthy',
        latency,
        message: 'API externa respondendo',
        timestamp: Date.now()
      };
    } else {
      return {
        service: 'external-api',
        status: 'degraded',
        latency,
        message: `API retornou ${response.status}`,
        timestamp: Date.now()
      };
    }
  } catch (error) {
    return {
      service: 'external-api',
      status: 'unhealthy',
      message: `Erro: ${error.message}`,
      timestamp: Date.now()
    };
  }
});
```

## Configurações e Personalização

### 1. Intervalo de Verificação

```typescript
// Padrão: 30 segundos
const healthChecker = new HealthChecker(
  60000,  // Verificar a cada 60 segundos
  10000   // Timeout de 10 segundos
);
```

### 2. Retenção de Métricas

```typescript
// Em MetricsCollector
private readonly maxDataPoints = 1000;      // Máximo de pontos
private readonly retentionPeriod = 3600000; // 1 hora
```

### 3. Thresholds de Status

```typescript
// Customizar limites de latência
const getStatus = (latency: number): string => {
  if (latency < 100) return 'healthy';
  if (latency < 500) return 'degraded';
  return 'unhealthy';
};
```

### 4. Cores e Estilos

```typescript
// Em monitoring-dashboard.tsx
const getStatusColor = (status: string) => {
  switch (status) {
    case 'healthy': return 'text-green-600 bg-green-100';
    case 'degraded': return 'text-yellow-600 bg-yellow-100';
    case 'unhealthy': return 'text-red-600 bg-red-100';
  }
};
```

### 5. Notificações

```typescript
// Adicionar listener para mudanças
healthChecker.onHealthChange((health) => {
  if (health.overall === 'unhealthy') {
    // Enviar notificação
    notify('Sistema com problemas!', 'error');
  }
});
```

## Boas Práticas

1. **Não sobrecarregar com checks**: Mantenha intervalo razoável
2. **Timeouts apropriados**: Evite checks muito longos
3. **Métricas relevantes**: Colete apenas o necessário
4. **Limpeza de dados**: Configure retenção adequada
5. **Tratamento de erros**: Sempre capture exceções
6. **Performance**: Use Web Workers para checks pesados

## Troubleshooting

### Dashboard não atualiza
- Verificar se auto-refresh está ativado
- Checar console para erros
- Verificar se healthChecker está rodando

### Métricas não aparecem
- Confirmar que collector está registrando
- Verificar categoria e nome da métrica
- Checar se não passou do período de retenção

### Status sempre unhealthy
- Revisar thresholds de latência
- Verificar conectividade real
- Checar permissões do navegador

---

*Última atualização: Janeiro 2025*

