    return window.isEmergencyMode || false;
  }

  static async checkHealth(): Promise<{
    status: 'healthy' | 'degraded' | 'emergency';
    details: any;
  }> {
    if (window.isEmergencyMode) {
      return {
        status: 'emergency',
        details: {
          mode: 'in-memory',
          dataSize: window.emergencyStore?.data.size || 0
        }
      };
    }

    if (!this.isInitialized) {
      return {
        status: 'degraded',
        details: { reason: 'Not initialized' }
      };
    }

    try {
      // Test database connection
      const result = await this.instance!.query('SELECT 1');

      return {
        status: 'healthy',
        details: {
          connected: true,
          tablesReady: true
        }
      };
    } catch (error) {
      return {
        status: 'degraded',
        details: {
          error: error instanceof Error ? error.message : 'Unknown error'
        }
      };
    }
  }

  static async reset(): Promise<void> {
    if (this.instance) {
      await this.instance.close();
    }

    this.instance = null;
    this.db = null;
    this.initPromise = null;
    this.isInitialized = false;
    this.retryCount = 0;

    // Clear emergency mode
    window.isEmergencyMode = false;
    if (window.emergencyStore) {
      window.emergencyStore.isActive = false;
      window.emergencyStore.data.clear();
    }
  }
}

// Initialize and export db instance
let db: ReturnType<typeof drizzle> | null = null;

// Initialize on first use
PGliteManager.initialize().then(() => {
  db = PGliteManager.getDb();
}).catch(error => {
  console.error('Failed to initialize database:', error);
});

// Export a getter that ensures initialization
export const getDb = () => {
  if (!db) {
    db = PGliteManager.getDb();
  }
  return db;
};

// Export db as a getter for compatibility
export { db };

export { PGliteManager };

